import React, { useState } from 'react';
import './Pageone.css'



const Page1 = ({ onNext }) => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    applicationDate: '',
    country: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData); // Process form data here or pass it to parent component
    onNext(); // Assuming you have a method to go to the next page
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>First Name:</label>
        <input type="text" name="firstName" value={formData.firstName} onChange={handleChange} required />
      </div>
      <div>
        <label>Last Name:</label>
        <input type="text" name="lastName" value={formData.lastName} onChange={handleChange} required />
      </div>
      <div>
        <label>Application Date:</label>
        <input type="date" name="applicationDate" value={formData.applicationDate} onChange={handleChange} required />
      </div>
      <div>
        <label>Country:</label>
        <select name="country" value={formData.country} onChange={handleChange} required>
          <option value="">Select a country</option>
          <option value="USA">USA</option>
          <option value="Canada">Canada</option>
          <option value="UK">UK</option>
          <option value="Australia">Australia</option>
          {/* Add more countries as needed */}
        </select>
      </div>
      <button type="submit">Save and Proceed</button>
    </form>
  );
};

export default Page1;
